paths:
  tmp0:
    post:
      description: Returns intelligence report(s) providing context to a searched
        indicator
      parameters:
      - description: Field to search
        example: ip
        in: query
        name: Field
        required: true
        schema: {type: string}
      - description: Field value to search
        example: 8.8.8.8
        in: query
        name: Value
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: ThreatScape Search Basic
  tmp1:
    post:
      description: View Indicators of Compromise Context Data
      parameters:
      - description: Number of minutes into the past to query
        example: '60'
        in: body
        name: Since
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: ThreatScape View IOCs
